Around the table we went.. each sharing one thing we were thankful for‚Ä¶ they varied of course, but there were a few that were repeated‚Ä¶ As heart breaking war and horrific acts of violence and hate are a reality for many tonight, thankfulness for peace seemed to be on our minds‚Ä¶ both in our country‚Ä¶ but also, as one of our children reminded us, the peace we have in our hearts in knowing God. It doesn‚Äôt mean the absence of conflict hardships of course, but rather an anchor in the storm and it‚Äôs a peace that passes all understanding. 

‚ÄòPeace I leave with you; my peace I give to you. Not as the world gives do I give to you. Let not your hearts be troubled, neither let them be afraid.‚Äù ‚ÄúTherefore, since we have been justified by faith, we have peace with God through our Lord Jesus‚Äô John 14:7 

Reminded again and will be praying tonight for those in war torn countries, for the innocent victims, regardless of nationality, and for Israel. For the safety of the families who are facing such danger. Praying for the release of hostages and the safe return of innocent captives. Praying for the leadership of Israel, that God will grant them His wisdom in protecting their nation and people.

.
Happy Thanksgiving from our family to yours!
