Apologies for the wall of text but it‚Äôs all important concepts and pretty well articulated by the OPs, so I don‚Äôt want to retread their points.
We need to be aware of the type of conflict that specific people are hoping kicks off against us, and to an extent the type of ideological battle we‚Äôre already forced into. Anything that happens to the Bad Guys is going to be justified, excused, downplayed, or ignored; it almost certainly will not get any real condemnation and no serious attempts will be made to prevent evils befalling the Bad Guys. And who, you may ask, has been cast as the villain in this production? Look no further than the mirror. When tax policy differences get you called an enemy combatant (‚ÄúPEOPLE WILL DIE‚Äù any time any Republican does anything but cave to progressives), we are in serious trouble. And recently people have fallen totally into the Soviet thought pattern of blaming normal people for the dysfunction of criminals, blaming ‚Äúoppressors‚Äù for brutal violence against innocent civilians and even kids, etc. 
These same patterns are showing up in the Israel-Palestine fighting, there are calls for legitimately evil violence and even genocide/ethnic cleansing on BOTH SIDES of the conflict with allegedly ‚Äúrespectable‚Äù American pundits and politicians on both sides. We need to be aware of the stakes: as soon as you challenge this huge swath of the world‚Äôs population on an issue they care deeply about, they will pull out all the stops and either rhetorically or literally scorch the earth, salt your lands, and wipe out your whole family in ‚Äúself-defense.‚Äù
